import React, { useState } from "react";
import { NavLink } from "react-router-dom";
import AddResource from "./AddResource";
function FrontEnd() {
  const [open, setOpen] = useState(false);

  const handleClickToOpen = () => {
    setOpen(true);
  };

  const handleToClose = () => {
    setOpen(false);
  };

  return (
    <div className="row">
      <div className="col-xl-6 mb-4">
        <div className="card">
          <div className="card-body">
            <div className="d-flex justify-content-between align-items-center">
              <div className="d-flex align-items-center">
                <img
                  src="https://mdbootstrap.com/img/new/avatars/8.jpg"
                  alt=""
                  style="width: 45px; height: 45px"
                  className="rounded-circle"
                />
                <div className="ms-3">
                  <p className="fw-bold mb-1">John Doe</p>
                  <p className="text-muted mb-0">john.doe@gmail.com</p>
                </div>
              </div>
              <span className="badge rounded-pill badge-success">Active</span>
            </div>
          </div>
          <div className="card-footer border-0 bg-light p-2 d-flex justify-content-around">
            <a
              className="btn btn-link m-0 text-reset"
              href="#"
              role="button"
              data-ripple-color="primary"
            >
              Message<i className="fas fa-envelope ms-2"></i>
            </a>
            <a
              className="btn btn-link m-0 text-reset"
              href="#"
              role="button"
              data-ripple-color="primary"
            >
              Call<i className="fas fa-phone ms-2"></i>
            </a>
          </div>
        </div>
      </div>
    </div>
  );
}

export default FrontEnd;
